class DemoCarousel extends Component {
    render() {
        return (

            <Carousel>
                <link rel="stylesheet" href="<NODE_MODULES_FOLDER>/react-responsive-carousel/lib/styles/carousel.min.css"/>
                <div>
                    <img src={burger} alt='burger' />
                    <p className="legend">Legend 1</p>
